Male. Tergum X membranous with a pair of small disto-mesal processes (
Fig. 9
). Superior appendages laterally compressed; in lateral view, branched, ventral branch slightly less robust than dorsal branch (
Fig. 7
); in dorsal view, relatively slender, length about 6 times width, with a small process and spines on inner surface (
Fig. 9
). Phallus robust, generally tube-like, with spines embedded apically; a single, robust process (phallic guide) arising from near the base of the inferior appendages (
Fig. 7
). Inferior appendages small; in ventral view, fused basally, slender paired apices separated narrowly by a mesal split (
Fig. 8
); in lateral view, narrowed at about midpoint (
Fig. 7
).

Female. Genitalia with a pair of large, slightly divergent ‘tongue-shaped’ lobes on sternite VIII (
Fig. 55
).
